import React from 'react'

import {Container} from 'semantic-ui-react'
import Header from './header'

const Layout = (props) => {

     return(

          <Container>
               <Header/>
               {props.children}
               <h1>I am a footer</h1>
          </Container>
     )
}

export default Layout;
